import React from 'react';
import { Icon } from '@iconify/react'; // Import Iconify's Icon component

function AddCart() {
  return (
    <div className="fixed bottom-0 w-full h-20 bg-white drop-shadow-2xl z-50 flex items-center justify-around px-4 rounded-t-lg border-t border-gray-200">
      {/* Home, Search, Profile, and Cart Icons */}
      <div className="flex justify-between w-full max-w-lg items-center">
        
        {/* Home Icon */}
        <div className="flex flex-col items-center cursor-pointer p-3 transition-all duration-300 ease-in-out hover:text-[#F39C12] hover:scale-110">
          <Icon icon="mdi:home" className="text-3xl text-[#F39C12] transition-all duration-300" />
          <span className="text-sm text-[#F39C12] mt-1">Home</span>
        </div>

        {/* Search Icon */}
        <div className="flex flex-col items-center cursor-pointer p-3 transition-all duration-300 ease-in-out hover:text-[#F39C12] hover:scale-110">
          <Icon icon="mdi:magnify" className="text-3xl text-[#F39C12] transition-all duration-300" />
          <span className="text-sm text-[#F39C12] mt-1">Search</span>
        </div>

        {/* Profile Icon */}
        <div className="flex flex-col items-center cursor-pointer p-3 transition-all duration-300 ease-in-out hover:text-[#F39C12] hover:scale-110">
          <Icon icon="mdi:account" className="text-3xl text-[#F39C12] transition-all duration-300" />
          <span className="text-sm text-[#F39C12] mt-1">Profile</span>
        </div>

        {/* Cart Icon */}
        <div className="flex flex-col items-center cursor-pointer p-3 transition-all duration-300 ease-in-out hover:text-[#F39C12] hover:scale-110">
          <Icon
            icon="fluent:cart-24-regular"
            className="text-3xl text-[#F39C12] transition-all duration-300"
            onClick={() => alert('Navigating to Cart...')} // Replace with actual cart navigation
          />
          <span className="text-sm text-[#F39C12] mt-1">Cart</span>
        </div>
      </div>
    </div>
  );
}

export default AddCart;
